import { Component, OnInit, Output, EventEmitter } from '@angular/core';
import { UsersService } from '../users.service'

@Component({
  selector: 'app-coutry-box',
  templateUrl: './coutry-box.component.html',
  styleUrls: ['./coutry-box.component.css']
})
export class CoutryBoxComponent implements OnInit{

  @Output() officialName = new EventEmitter();

  constructor(private user: UsersService){}
  ngOnInit() {
    this.user.getMoreData().subscribe(data=> {
      let dataSet = Object.entries(data)[0][1]
      this.officialName.emit(dataSet.name.official)


    })
  }
}
